import React from "react";

function Login({ setUser }) {
  // const [username, setUsername] = useState("");
  // const [password, setPassword] = useState("");

  // function handleSubmit(e) {
  //   e.preventDefault();
  //   fetch("/login", {
  //     method: "POST",
  //     headers: {
  //       "Content-Type": "application/json",
  //     },
  //     body: JSON.stringify({ username, password }),
  //   }).then((r) => {
  //     if (r.ok) {
  //       r.json().then((user) => setUser(user));
  //     }
  //   });
  // }

  return (
<div className="section pt-0">
		<div className="container pt-0">
			<div className="row full-height justify-content-center pt-0">
				<div className="col-12 text-center align-self-center py-5 pt-0">
					<div className="section pb-5 pt-0 pt-sm-0 text-center pt-0">
						<h6 className="mb-0 pb-0 text-black"><span>Log In</span><input className="checkbox" type="checkbox" id="reg-log" name="reg-log"/>
			          	<label for="reg-log"></label><span> Sign Up</span></h6>



						<div className="card-3d-wrap mx-auto pt-0">
							<div className="card-3d-wrapper">
								<div className="card-front">
									<div className="center-wrap">
										<div className="section text-center">
											<h4 className="mb-4 pb-3">Log In</h4>
											<div className="form-group">
												<input type="email" className="form-style" placeholder="Email" />
												<i class=" input-icon bi bi-envelope-at-fill"></i>
											</div>	
											<div className="form-group mt-2">
												<input type="password" className="form-style" placeholder="Password" />
												<i class=" input-icon bi bi-key-fill"></i>
											</div>
											<button href="#/" className="btn1 mt-4 btn btn-outline-info">Login</button>
                      <p className="mb-0 mt-4 text-center"><a href="#/" className="link">Forgot your password?</a> </p>

				      					</div>
			      					</div>
			      				</div>

								<div className="card-back">
									<div className="center-wrap">
										<div className="section text-center pt-0">
											<h4 className="mb-3 pb-3">Sign Up</h4>

											<div className="form-group mt-2">
												<input type="tel" className="form-style" placeholder="Username" />
												<i className="input-icon bi bi-person-fill-add"></i>
											</div>	
                      <div className="form-group mt-2">
												<input type="email" className="form-style" placeholder="Email" />
												<i class=" input-icon bi bi-envelope-at-fill"></i>
											</div>
											<div className="form-group mt-2">
												<input type="password" className="form-style" placeholder="Password" />
												<i class=" input-icon bi bi-key-fill"></i>
											</div>
											<button href="#/" className="btn1 mt-4 btn btn-outline-info">Register</button>
				      					</div>
			      					</div>
			      				</div>
			      			</div>
			      		</div>
			      	</div>
		      	</div>
	      	</div>
	    </div>
	</div>
  );
}

export default Login;
